package com.example.e_commerceshopping.ui.cart

import android.view.LayoutInflater
import android.view.View
import android.view.ViewGroup
import androidx.recyclerview.widget.LinearLayoutManager
import com.example.e_commerceshopping.R
import com.example.e_commerceshopping.base.ui.BaseFragment
import com.example.e_commerceshopping.data.product.model.Product
import com.example.e_commerceshopping.databinding.FragmentCartBinding
import com.example.e_commerceshopping.extension.onClick
import com.example.e_commerceshopping.ui.MainActivity

class CartFragment : BaseFragment<FragmentCartBinding, MainActivity>() {

    private val cartAdapter = CartAdapter(listOf())

    override fun onInflateView(
        inflater: LayoutInflater,
        container: ViewGroup?
    ): FragmentCartBinding = FragmentCartBinding.inflate(inflater)

    override fun setupView() {
        binding.apply {
            showBottomNav(true)
            header.tvTitle.setText(R.string.cart)
            header.btnDelete.visibility = View.GONE
            header.ivNavigateBefore.visibility = View.GONE

            rcProductCart.adapter = cartAdapter
            rcProductCart.layoutManager = LinearLayoutManager(requireContext(), LinearLayoutManager.VERTICAL, false)

            cartAdapter.submitList(
                listOf(
                    Product("Apple watch 0","data:image/jpeg;base64," , 500, "Series 2", "", 5),
                    Product("Apple watch 1","data:image/jpeg;base64," , 500, "Series 2", "", 3),
                    Product("Apple watch 2","data:image/jpeg;base64," , 500, "Series 2", "", 1),
                    Product("Apple watch 3","data:image/jpeg;base64," , 500, "Series 2", "", 1),
                    Product("Apple watch 3","data:image/jpeg;base64," , 500, "Series 2", "", 1)
                )
            )

            btnCheckout.onClick{
                navigateTo(
                    R.id.action_cartFragment_to_checkOutFragment,
                    null,
                    R.id.nav_cart,
                    false
                )
            }
        }
    }

    override fun setupData() {

    }

}